import React, {Component} from 'react';
import Linkify from 'react-linkify';
import './DisplayCostumes.css';

class DisplayCostume extends Component {
    constructor(props){
        super(props);
    }

    getCostumes(){
        let data = JSON.parse(sessionStorage.getItem("costumeData"));
        if(data){
            PostData('costumes', this.state).then((result) => {
                let responseJson = result;
                if(responseJson.costumeData){
                    sessionStorage.setItem('costumeData',JSON.stringify(responseJson));
                }
                else{
                    alert(result.error);
                }
            });
        }
    }

    render(){
        let costumes = this.props.costumeData
        .map(function (costumeData, index) {
        return (
        <div className="medium-12 columns" key={index}>

        <div className="people-you-might-know">

        <div className="row add-people-section">
        <div className="small-12 medium-10 columns about-people">

        <div className="about-people-author">
        <p className="author-name">
        
        <Linkify>{costumeData.feed}</Linkify>

        <br/>

        </p>

        </div>
        </div>
        </div>
        </div>
        </div>
        )
        }, this);

        return (
        <div>
        {costumes}

        </div>
        );

    }
}

export default DisplayCostume;
